import React from "react";
import { useNavigate } from "react-router-dom";
const Error = () => {
  const navigate = useNavigate();
  new Promise((resolve) => setTimeout(resolve, 500));
  navigate("/");

  return <div>잘못된 경로입니다.</div>;
};

export default Error;
